Автомобиль в хорошем состоянии! Родной окрас! Полностью обслужен!

Хорошая комплектация:

7 мест;

Проекционный экран;

Подогрев сидений;

4-х зонный климат контроль;

Панорама;

Стекла AS3;

Шторки;

И многое другое...

В ходе диагностики не выявлено никаких недостатков, кроме ошибки по датчику давления шин.

Мы находимся по адресу Дунина-Марцинкевича 3/1 на минус 2-ом уровне крытого паркинга ТЦ «Тивали» где всегда тепло и сухо, так что вне зависимости от погоды, Вы можете комфортно и внимательно его осмотреть. Всего в 300м. от ст.м "Спортивная" и 600м от ст.м "Пушкинская".

Огромная просьба звонить перед выездом к нам на площадку.

- снята с учета;

- готова к продаже;

- продажа в Кредит и Лизинг;

- гарантия юридической чистоты;

- приём авто в Зачет (trade-in);

- срочный выкуп Вашего Авто;

- наши Авто проходят диагностику и предпродажную проверку;

- аргументированный торг.

ООО "Авалон Авто" думает и заботится о своих клиентах, поэтому приобрести любой из наших автомобилей, Вы можете в любое время, 7 дней в неделю с 10-00 до 19-00, после 19-00 по предварительному звонку.

Режим работы:

Понедельник - суббота: 10.00 - 19.00

Воскресенье: 10.00 - 17.00
